define('views/projects',[ 
    'jquery',
    'underscore',
    'backbone',
    'handlebars',
    'bootstrap',
    'views/project',
    'models/project',
    'collections/project',
    'text!templates/projects.html',
    ],
    function ( $ , _ , Backbone, Handlebars, Bootstrap, ProjectView, ProjectModel, ProjectCollection, ProjectsTemplate) { 
        $.fn.serializeObject = function() { var o = {}; var a = this.serializeArray(); $.each(a, function() { if (o[this.name] !== undefined) { if (!o[this.name].push) { o[this.name] = [o[this.name]]; } o[this.name].push(this.value || ''); } else { o[this.name] = this.value || ''; } }); return o; };
        return Backbone.View.extend({
            el: $('.content'),

            initialize: function(){
                that = this
                this.collection = new ProjectCollection()
                this.collection.fetch().done(function(){
                    that.render();
                })
            },
            events: {
                'submit .addProject': 'addProject',
            },

            addProject: function(ev){
                that = this
                data = $(ev.target).serializeObject()
                project = new ProjectModel(data)
                project.save().done(function(id){
                    project.set({'id': id})
                    that.collection.add(project)
                    var view = new ProjectView({model: project})
                })
                ev.target.reset()
                return false;
            },

            deactivate: function() {
                this.$el.empty();
                this.stopListening();
                this.undelegateEvents();
                return this;
            },

            render: function(){
                var template = Handlebars.compile(ProjectsTemplate)
                this.$el.html(template())
                this.collection.each(function(item){
                    var view = new ProjectView({model: item})
                })
            },
        })
    }
)
;
define('router',[ 
    'jquery',
    'underscore',
    'backbone',
    'views/home',
    'views/projects'
    ],
    function ( $ , _ , Backbone, HomeView, ProjectsView) { 
        AppRouter = Backbone.Router.extend({
            routes: {
                '':  'home',
                'projects': 'projects',
                'bugs(/status:statuses)(/date:date)(/projects:projects)': 'home',
            },

            home: function(statuses, date, projects){
                if (statuses)
                    statuses = _.map(statuses.split('.'), function(status_id){ return Number(status_id); })
                else
                    statuses = []

                if (projects)
                    projects = _.map(projects.split('.'), function(project){ return Number(project); })
                else
                    projects = []

                if (!(date))
                    date = 0

                $('.top-menu li').removeClass('active')
                $('.bugs').addClass('active')

                if (this.siteView)
                    this.siteView.deactivate()
                this.siteView = new HomeView({ statuses: statuses,
                                               date: date,
                                               projects: projects,});
             },

             projects: function(){
                $('.top-menu li').removeClass('active')
                $('.projects').addClass('active')

                if (this.siteView)
                    this.siteView.deactivate()
                this.siteView = new ProjectsView();
             },
        })


        var initialize = function(){
            var app_router = new AppRouter();
            Backbone.history.start();
        }

        return {'initialize': initialize }

    }
);

